            borderWidth: 2,
          },



        ],
      });


    return(
      <> 
      Welcome to Bruinfit

         <div style={{ width: 800 }}>

        Overall Weight Change:
        <LineChart chartData={userData} />  </div>
      </>

    );
}

export default Home;
